import React from "react";
import { Row, Col } from "antd";
import { useRouter } from "next/router";

import { WidthImg, centerCol, StartButton } from "../assets/css/style_index";

const Home = () => {
	const router = useRouter();

	const toTest = () => {
		router.push("/test");
	};

	return (
		<>
			<Row
				justify="center"
				style={{ height: "100vh", backgroundColor: "#f66a70" }}
			>
				<Col {...centerCol}>
					{/* <Texty strong top={100} bottom={0} font={20} color={"#fff"}>
						나랑 어울리는 애완동물은?
					</Texty> */}

					<WidthImg
						src={require("../assets/images/index/header.png")}
					/>
					<WidthImg
						src={require("../assets/images/index/logo.png")}
					/>
					<div style={{ height: "50px" }}></div>
					<WidthImg
						src={require("../assets/images/index/deoksun.png")}
					/>

					<StartButton top={-50} onClick={toTest}>
						시작 하기
					</StartButton>
				</Col>
			</Row>
		</>
	);
};

export default Home;

